def listDedup(l):
    L = list(l)
    n = 0
    while n <= len(L):
        i = 0
        j = 1
        while j < len(L):
            if (L[i] <= L[j]) & (L[j] <= L[i]):
                j = j + 1
                L.pop(j - 1)
            else:
                j = j + 1
        L.append(L.pop(i))      
        print("new list looks like this: ", L)
        n = n + 1
        print("n = ", n, " ; length of L = ", len(L))
    print("length of L = ", len(L), "; the final deduped list is: ", L)		

